selector_to_html = {"a[href=\"barcode.html#upc-a\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">UPC-A<a class=\"headerlink\" href=\"#upc-a\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id5\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#plessey-telepen\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Plessey/Telepen<a class=\"headerlink\" href=\"#plessey-telepen\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id34\" title=\"Link to this heading\">#</a></h3>", "a[href=\"character.html#transmit-code-id-character\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Trasmetti Carattere ID Codice<a class=\"headerlink\" href=\"#transmit-code-id-character\" title=\"Link to this heading\">#</a></h2><p>Un carattere ID codice identifica il tipo di codice di un codice a barre scansionato. Questo pu\u00f2 essere utile quando si decodifica pi\u00f9 di un tipo di codice. Il carattere ID codice \u00e8 inserito tra il carattere prefisso (se selezionato) e il simbolo decodificato.</p>", "a[href=\"barcode.html#code-39\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Codice 39<a class=\"headerlink\" href=\"#code-39\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id14\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#industrial-2-of-5\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Industria 2 di 5<a class=\"headerlink\" href=\"#industrial-2-of-5\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id27\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#ean-8\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">EAN-8<a class=\"headerlink\" href=\"#ean-8\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#enable-disable\" title=\"Link to this heading\">#</a></h3>", "a[href=\"keyboard.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Impostazioni Tastiera<a class=\"headerlink\" href=\"#keyboard-settings\" title=\"Link to this heading\">#</a></h1><h2>Lingua Della Tastiera<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Link to this heading\">#</a></h2><h3>Americano<a class=\"headerlink\" href=\"#american\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#interleaved-2-of-5\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Interfogliatura 2 di 5<a class=\"headerlink\" href=\"#interleaved-2-of-5\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id24\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#msi\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">MSI<a class=\"headerlink\" href=\"#msi\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id30\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html#duplicate-barcode-detection-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Impostazioni Di Rilevamento Codici A Barre Duplicate<a class=\"headerlink\" href=\"#duplicate-barcode-detection-settings\" title=\"Link to this heading\">#</a></h2><h3>Disabilita<a class=\"headerlink\" href=\"#id1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"character.html#end-character-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Impostazioni Dei Caratteri Finali<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Link to this heading\">#</a></h2><p>Il carattere finale viene aggiunto dopo i dati decodificati nel formato dei dati decodificati + carattere finale.</p>", "a[href=\"scanmode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Scansione<a class=\"headerlink\" href=\"#scan-mode\" title=\"Link to this heading\">#</a></h1><h2>Modalit\u00e0 Tasto Innesco<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Premere il pulsante per attivare la scansione e rilasciare il pulsante per terminare la scansione. La scansione termina quando la scansione ha successo o il tempo di lettura supera il tempo di lettura singolo.</p>", "a[href=\"barcode.html#codabar\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Codabar<a class=\"headerlink\" href=\"#codabar\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id12\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#gs1-databar-expanded-rss-expanded\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">GS1 DataBar Espanso (Rss Espanso)<a class=\"headerlink\" href=\"#gs1-databar-expanded-rss-expanded\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id23\" title=\"Link to this heading\">#</a></h3>", "a[href=\"character.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Carattere<a class=\"headerlink\" href=\"#character\" title=\"Link to this heading\">#</a></h1><h2>Impostazioni Dei Caratteri Finali<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Link to this heading\">#</a></h2><p>Il carattere finale viene aggiunto dopo i dati decodificati nel formato dei dati decodificati + carattere finale.</p>", "a[href=\"barcode.html#code-93\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Codice 93<a class=\"headerlink\" href=\"#code-93\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id17\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#code-11\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Codice 11<a class=\"headerlink\" href=\"#code-11\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id13\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#m1-wired-scanner-quick-setup-guide\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><strong>M1</strong> Wired Scanner Guida Di Configurazione Rapida<a class=\"headerlink\" href=\"#m1-wired-scanner-quick-setup-guide\" title=\"Link to this heading\">#</a></h1>", "a[href=\"barcode.html#reverse-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Simbologie Inversa<a class=\"headerlink\" href=\"#reverse-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html#restore-default-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ripristina Impostazioni Predefinite<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Quando si verifica un errore sconosciuto sullo scanner, \u00e8 possibile ripristinare lo scanner ripristinando le impostazioni predefinite.</p>", "a[href=\"barcode.html#gs1-databar-omnidirectional-rss-omnidirectional\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">GS1 DataBar Omnidirezionale (RSS Omnidirezionale)<a class=\"headerlink\" href=\"#gs1-databar-omnidirectional-rss-omnidirectional\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id22\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html#key-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Tasto Innesco<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Premere il pulsante per attivare la scansione e rilasciare il pulsante per terminare la scansione. La scansione termina quando la scansione ha successo o il tempo di lettura supera il tempo di lettura singolo.</p>", "a[href=\"barcode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Simbologie<a class=\"headerlink\" href=\"#symbologies\" title=\"Link to this heading\">#</a></h1><h2>Simbologie Inversa<a class=\"headerlink\" href=\"#reverse-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Impostazioni Di Sistema<a class=\"headerlink\" href=\"#system-settings\" title=\"Link to this heading\">#</a></h1><h2>Ripristina Impostazioni Predefinite<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Quando si verifica un errore sconosciuto sullo scanner, \u00e8 possibile ripristinare lo scanner ripristinando le impostazioni predefinite.</p>", "a[href=\"barcode.html#upc-e\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">UPC-E<a class=\"headerlink\" href=\"#upc-e\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id9\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#volume-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Impostazioni Volume<a class=\"headerlink\" href=\"#volume-settings\" title=\"Link to this heading\">#</a></h2><p>Scansiona il codice di impostazione corrispondente per attivare/disattivare il prompt del suono dello scanner</p>", "a[href=\"barcode.html#ean-13\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">EAN-13<a class=\"headerlink\" href=\"#ean-13\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#china-post\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Cina Post<a class=\"headerlink\" href=\"#china-post\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id29\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#code-128\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Codice 128<a class=\"headerlink\" href=\"#code-128\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id19\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html#auto-sensing-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Di Sensibilit\u00e0 Automatica<a class=\"headerlink\" href=\"#auto-sensing-mode\" title=\"Link to this heading\">#</a></h2><p>Nella modalit\u00e0 di rilevamento automatico, lo scanner rileva la luminosit\u00e0 dell\u2019ambiente circostante. Quando la luminosit\u00e0 cambia, la scansione viene attivata. La scansione termina quando la scansione ha successo o il tempo di scansione supera il tempo di lavoro singolo. Indipendentemente dal fatto che l\u2019ultima scansione abbia avuto successo o fallito, la luminosit\u00e0 dell\u2019ambiente circostante verr\u00e0 nuovamente rilevata.</p>", "a[href=\"system.html#get-firmware-version\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ottieni Versione Firmware<a class=\"headerlink\" href=\"#get-firmware-version\" title=\"Link to this heading\">#</a></h2>", "a[href=\"keyboard.html#keyboard-language\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Lingua Della Tastiera<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Link to this heading\">#</a></h2><h3>Americano<a class=\"headerlink\" href=\"#american\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html#continuous-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Continua<a class=\"headerlink\" href=\"#continuous-mode\" title=\"Link to this heading\">#</a></h2><p>Lo scanner funziona in modo continuo. Se la scansione \u00e8 riuscita o il tempo di scansione supera il tempo di lavoro singolo, la scansione corrente termina. Se il tempo supera il tempo specificato, la scansione successiva viene attivata automaticamente.</p>", "a[href=\"barcode.html#gs1-databar-limited-rss-limited\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">GS1 DataBar Limited(Rss Limited)<a class=\"headerlink\" href=\"#gs1-databar-limited-rss-limited\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id21\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#matrix-2-of-5\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Matrice 2 di 5<a class=\"headerlink\" href=\"#matrix-2-of-5\" title=\"Link to this heading\">#</a></h2><h3>Abilita/Disabilita<a class=\"headerlink\" href=\"#id28\" title=\"Link to this heading\">#</a></h3>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
